import React from "react";


const FooterPage = () => {
  return (
   <>
   <div style={{ padding: '10px' , width: '100%',height: "20vh", backgroundColor: 'black', color: 'white', display :"flex", justifyContent: "space-between", alignItems: "center"}}>
   <div style={{display: "flex", flex:1}}>left </div>
   <div style={{flex:1}}>
     <ul Style={{ backgroundColor: 'red', border:"1px solid white"}}>
       <li><a href="#">Mobile</a></li>
       <li><a href="#">Mobile</a></li>
       <li><a href="#">Mobile</a></li>
       <li><a href="#">Mobile</a></li> 
     </ul>
      </div>
   <div style={{flex:1}}>right </div>
   </div>
   </>
  );
}

export default FooterPage;
